import { createWebHistory, createRouter } from 'vue-router'

const routes = [
    {
        name: 'scheduleTask',
        path: '/scheduleTask',
        component: () => import('./components/ScheduleTask')
    },
    {
        name: 'cronLogs',
        path: '/home/cronLogs',
        component: () => import('./components/cronLogs')
    },
]

const router = createRouter({
    history: createWebHistory(),
    routes,
});
export default router;
